import ReactDom from "react-dom";

function Overlay() {


  const overlayStyle = {
    position: "fixed",
    top: 0,
    right: 0,
    bottom: 0,
    left: 0,
    backgroundColor: "rgba(0, 0, 0, 0.675)",
    zIndex: 1000,
  };

  return ReactDom.createPortal(<div style={overlayStyle}></div>, document.getElementById("portal"));
}

export default Overlay;
